import React from 'react';
import { Grid,Container } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';


const useStyles = makeStyles( theme => {

    return {
        dispFilter:{
            display:'flex',
            flexDirection:'row',
            alignItems:'center',
            fontSize:'14px',

        }
    }
    
});


export const Filter = ({fil}) => {
    

    const {dispFilter} = useStyles();

    return (
        <Container>
            <Grid className={dispFilter} item md={3} xs={12}>
                    {fil}

            </Grid>
        </Container>
    )
}
